import React, { useState } from 'react'
import { SearchOutlined } from '@ant-design/icons'
import axios from 'axios'
import './index.css'

export default function Subsribe() {
  const [input, setInput] = useState('')
  const handleChange = (e) => {
    // 更新value
    setInput(e.target.value)
  }
  const axios = require('https://cdn.jsdelivr.net/npm/axios/dist/axios.min.js')
  const getWords = () => {
    axios.post('https://hmajax.itheima.net/api/ambition').then(result => {
      console.log(result);
    })
  }
  return (
    <div>
      <div className="search">
        {/* 搜索模块 */}
        <i><SearchOutlined /></i>
        <input type="text" value={input} placeholder='请输入关键词' onChange={(e) => handleChange(e)} />
      </div>
      <h2>我的订阅</h2>
      <div className='good-words'>
        <getWords />
      </div>
    </div>

  )
}
